import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the public events grid to load
    await page.waitForSelector('#publicEventsGrid');

    // Extract event cards
    const events = await page.$$eval('#publicEventsGrid .event-card', cards => {
      return cards.map(card => ({
        title: card.querySelector('.event-title')?.innerText || '',
        date: card.querySelector('.event-date')?.innerText || '',
        creator: card.querySelector('.event-creator')?.innerText || ''
      }));
    });

    // Take a screenshot of the events grid
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_events_grid.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_events_grid.png'));

    return {
      success: true,
      action: "Verified public events are displayed in the Public Events section",
      extractedData: { events },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

